def TreeMaxPath(g):
    n  = len(g)
    ans=0
    visit =[0]*n
    def dfs(x):
        nonlocal ans
        visit[x] = 1
        for y,c in g[x]:
            if visit[y] : continue
            dfs(y)
            ans = max(ans,d[x] + d[y]  + c)
            d[x] = max(d[x], d[y] + c)
        #print(x, d,ans)
    d =[0]*n
    for i in range(n):
        if visit[i] ==0:
            dfs(i)
    return ans
class Solution(object):
    def longestPath(self, parent, s):
        """
        :type parent: List[int]
        :type s: str
        :rtype: int
        """
        
        n = len(parent)
        g =[[] for _ in range(n)]
        for i in range(1,n):
            a = s[i]
            b = s[parent[i]]
            if a != b:
                g[i].append((parent[i],1))
                g[parent[i]].append((i,1))
        ans = TreeMaxPath(g)
        return ans+1

